import { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMapLocationDot } from '@fortawesome/free-solid-svg-icons';

function Icon() {
  const [isClicked, setIsClicked] = useState(false);

  const handleClick = () => {
    setIsClicked(true);
  }

  return (
    <div>
      {isClicked ? (
        <div className="new-div">This is the new div</div>
      ) : (
        <FontAwesomeIcon icon={faMapLocationDot} className="my-icon" onClick={handleClick} />
      )}
    </div>
  );
}

export default Icon;
